import React from "react";
import "./Weather.css";

export default function Weather() {
  return (
    <div className="Weather">
      <h1>Swakopmund</h1>
      <ul>
        <li>Last updated:</li>
        <li>Clear skies</li>
      </ul>
    </div>
  );
}
